import{_ as t,c as o,o as n,ah as i}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"SWISSPOST SHIPPING","description":"SWISSPOST SHIPPING","frontmatter":{"title":"SWISSPOST SHIPPING","description":"SWISSPOST SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/swisspost-shipping.md","filePath":"zenith/featured-app/shipping/swisspost-shipping.md"}'),s={name:"zenith/featured-app/shipping/swisspost-shipping.md"};function a(r,e,p,l,h,g){return n(),o("div",null,[...e[0]||(e[0]=[i('<p>The <a href="/zenith/introduction/">Multi-vendor Marketplace</a> has introduced another shipping feature app for order fulfillment named <a href="https://www.post.ch/en/" target="_blank" rel="noreferrer"><strong>Swiss Post</strong></a> i.e <strong>the national postal service of Switzerland.</strong></p><p>By enabling the Swiss Post shipping featured app, the admin can allow sellers to manage the order fulfillment via Swiss Post shipping.</p><p>Also, automatically generate shipping labels for the orders.</p><p>This feature app will charge you a minimal amount of <strong>$10 per month</strong> over and above your current Multivendor plan.</p><p>NOTE:- This Swiss Post shipping feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month).</p><p>Moreover, you need to enable the <strong><a href="/zenith/featured-app/overview.html">Shipping</a></strong> Add-on for FREE from the ‘Feature Apps’ section of the app.</p><p>Also, Access to Shipping requires your Shopify store to be on the plan that supports <a href="https://help.shopify.com/en/manual/shipping/setting-up-and-managing-your-shipping/enabling-shipping-carriers" target="_blank" rel="noreferrer"><strong>Real-Time Carrier-Calculated Shipping</strong>.</a></p><p>The Swiss post Shipping feature is compatible with the <strong><a href="https://webkul.com/blog/shopify-multivendor-marketplace-partial-fulfillment/" target="_blank" rel="noreferrer">Partial Fulfillment</a></strong> feature.</p><p>SWISS POST FEATURE APP IS AVAILABLE <strong>ONLY FOR FULFILLMENT</strong>.</p><h2 id="how-to-activate-swiss-post-shipping" tabindex="-1">How to Activate Swiss Post Shipping? <a class="header-anchor" href="#how-to-activate-swiss-post-shipping" aria-label="Permalink to &quot;How to Activate Swiss Post Shipping?&quot;">​</a></h2><p>To enable the feature app, all you need to do is to visit the “<strong>Featured Apps</strong>” section of the admin panel and enable it from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="Feature App-shipping"></p><p>Once you click on “Feature Apps”, you will get the list of apps listing in this section. There, You will get the Swiss Post feature. You just need to click the <strong>enable</strong> button.</p><p>In this way, you can enable the feature within your Multivendor App.</p><h2 id="workflow" tabindex="-1">Workflow <a class="header-anchor" href="#workflow" aria-label="Permalink to &quot;Workflow&quot;">​</a></h2><p><strong>ADMIN END</strong><br> Once you enable this feature app, a new sub-menu gets added in the Configuration menu of the app i.e. Swiss Post Configuration.</p><p><strong>Please</strong> <strong>Note</strong>:- You need to have <a href="https://account.post.ch/idp/?login" target="_blank" rel="noreferrer">an account on Swiss Post</a> to configure the details in the app.</p><p>Before this, You need to visit the Configuration&gt;&gt;Shipping Methods and <strong>enable the Swiss Post Shipping</strong> as shown in the below screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/dashboardshippingmethods.webp" alt="Dashboard-Admin-5"></p><p>Enable the Swiss Post Shipping:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/enableswisspost.webp" alt="Configuration-Admin-30"></p><p>Now, proceed to configure Swiss Post details</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/swisspostconfigone.webp" alt="Configuration-Admin-31"></p><h2 id="swiss-post-configuration" tabindex="-1">Swiss Post Configuration <a class="header-anchor" href="#swiss-post-configuration" aria-label="Permalink to &quot;Swiss Post Configuration&quot;">​</a></h2><p>In this section, you need to configure Swiss Post shipping details such as Client ID, Secret Key and Franking License Number. You will get all these details from your <a href="https://www.post.ch/en/" target="_blank" rel="noreferrer">Swiss Post account</a>.</p><p>Moreover, to allow sellers to generate the shipping labels automatically on fulfilled orders, you need to enable the tab in the configuration menu.</p><p>Receive Parcel To Your Address:- In case you want to receive the parcel at your address, you need to enable the tab and enter the address for which you want to generate the shipping label.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/swisspostconfigtwo.webp" alt="Swisspost-Configuration-Admin"></p><h2 id="automatic-fulfilment" tabindex="-1">Automatic Fulfilment <a class="header-anchor" href="#automatic-fulfilment" aria-label="Permalink to &quot;Automatic Fulfilment&quot;">​</a></h2><p>In case you want to auto-fulfill the product at the time of order creation, you just need to enable RECEIVE PARCEL TO YOUR ADDRESS option&gt;&gt;</p><p>Enable <strong>AUTOMATIC FULFILLMENT</strong> option in the Swiss Post Configuration menu in the app.</p><p><em>Note: High risk orders will not be auto fulfilled</em>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/swisspostconfigthree.webp" alt="Swisspost-Configuration-Admin-1"></p><h4 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h4><p>To use this feature add-on, the admin needs to make the <strong>Shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>To do this, You need to go to Shopify Backend &gt; Settings &gt; Checkout &gt; Under Form Options, make the Shipping address phone number as <strong>Required</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify-1200x597.png" alt="J&amp;T Express Shipping"></p><h2 id="seller-panel" tabindex="-1">Seller Panel <a class="header-anchor" href="#seller-panel" aria-label="Permalink to &quot;Seller Panel&quot;">​</a></h2><p>Once you configure these details, the sellers will also get the option to enable the Swiss Post shipping from the <strong>Shipping Configuration</strong> menu of their seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerenableswisspost.webp" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-7"></p><p>In case, the sellers need to configure the shipping parcel details, this can be done from the Global Shipping Configuration:-</p><p>Configure Width, height, length, girth, and weight.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/globalconfig.webp" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-8"></p><p>Now, the seller can fulfill orders via the Swiss Post shipping courier service.</p><h2 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h2><p>Both admin and seller can generate the shipping label for the fulfilled orders. Admin can configure the shipping Label details from his admin panel.</p><p>Seller needs to follow the below-given steps to generate shipping labels for fulfilled orders:</p><ul><li>Login to Multi-vendor <strong>Seller</strong> <strong>Panel</strong>.</li><li>Go to <strong>Orders</strong>.</li><li>Visit the <strong>Order Listing</strong> section.</li><li>Select the <strong>Order</strong> for which You want to <strong>Generate Shipping Label.</strong></li><li>Proceed to fulfill the order.</li></ul><p>Clicking the Fulfill button, you need to select the <strong>Swiss Post</strong> as the shipping method.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="Screenshot-2020-12-14T191434.522"></p><p>The sellers can check the fulfillment details from the Order Listing section.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/12/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-5-1200x597.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace-5"></p><p>Thus, the shipping label will be generated automatically for the fulfilled orders. Thus, the seller can easily print the shipping label.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/12/Screenshot-2020-12-14T191909.121.png" alt="Screenshot-2020-12-14T191909.121"></p><h2 id="demo" tabindex="-1">DEMO <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;DEMO&quot;">​</a></h2><p>Link to check the demo of Multi-vendor Marketplace app for Shopify: <a href="https://multivendor-marketplace-5.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com</a></p>',56)])])}const c=t(s,[["render",a]]);export{u as __pageData,c as default};
